후반:터포키!!!!!

RT @Cross_Riffle: 이번화 보기 전과 후의 제 캐해석 변화 좀 개쩔고 머리깨는데 일단 귀엽게(?)그려봣음
장관을 어떻게 생각해?&lt;&lt;
이번화 전 스:아 뭐 걍 불쌍한데...내 인생 조졌고...근데 아무도 나 못알아보고 졸라 내 인생도 시망…

RT @dulci_0213: 빙산씨랑 장관님이랑 휴가로 조용한 섬에 가서 해질 무렵에 해변산책하면 조케따. 장관님 간만에 일몰 봐서 센치오져서 막 질질 울면서 걸어서 빙산씨 첨엔 당황함

빙 : 왜, 왜울어?;;
장 : 엉엉 해 지는게 넘 아름다워…

그래도 으 내가 너무 심했나? 하고 아직 정신 못차리고 있는 상태...
뭐 혼났으니까 그래 앞으로는 잘해보자 하고 병문안을 가는데 아카이누 보는 순간 그래도 회복하던 장관이 그대로 기절하고 내쫓김
아카이누 그제서야 좀 심각성을 깨닫고 ;;;;당황;;

트위터 하는 cp들도 좋지만 스레딕하는 cp들도 보고싶다. 여기는 아예 익명이니까.
예를 들면
&lt;장관님&gt;로비판에는 전설이 있어&lt;일화모음&gt;
&lt;모아보자&gt;장관님이 좋아하시는 것들&lt;간식편&gt;

&gt;그림리퀘박스받습니다&lt;
멘션주시면 랜덤으로 그려드릴게요 퀄리티 보장못함 장관님 한정....
(근데 이런거 괜찮나요?)

